Jewel Quest Mysteries: The Oracle of Ur CE - Wendy99 


Genre: Hidden Object | Puzzle


The fourth installment to the award-winning Jewel Quest Mysteries series is here. Rupert is back along with his two best friends, Emma and Sebastian. The three heroes are on a quest to find the most coveted jewel board of all, the Oracle of Ur. Can they successfully retrieve the Oracle of Ur?


 Play as Emma, Rupert, and Sebastian
 Explore beautiful locations as you uncover many hidden objects
 Enjoy fun mini-games, solve puzzles, and complete jewel boards


Collector's Edition Features:


 Over 20 extra puzzles
 6 extra-challenging jewel boards
 Strategy Guide
 Wallpaper


System Requirements:


OS: Windows XP | Windows Vista | Windows 7
CPU: 1.0 GHz
RAM: 512 MB
DirectX: 9.0
Hard Drive: 365 MB


Install and play.


